properties.info:
Electric vehicles charging stations (on the 1st level) charge $2.00 per hour for use.

Validation:
Monday - Friday until 8pm – 3 hours of free parking with validation;
after 8pm – no validation is necessary;
Saturday and Sunday – no validation is necessary.

The Westin Bellevue (hotel parking):
Valet parking is available at the front door of The Westin Bellevue. If you prefer to self-park, you will be directed to the Lincoln Square Parking Garage. Park on level P4 near the south elevators and take the elevator up to the hotel lobby. There are signs to tell you where to go;
Overnight self-parking is $36.00 during the week, but complimentary on Friday &amp; Saturday nights. Hourly parking is available for special events.
